import React from "react";
import ReactDOM from "react-dom";

import "./index.scss";
import App from "./App";

import { ThemeProvider } from "styled-components";
import ProvideThemes from "./utility/ProvideThemes";

//% Make our data from ProvideThemes.js accessible to all components
ReactDOM.render(
  <ThemeProvider theme={ProvideThemes}>
    <App />
  </ThemeProvider>,
  document.getElementById("root")
);
